import axios from 'axios'


class ApiService
{

    fetchUsers() {
        return axios.get('http://localhost:8080/WishTreeProject/GetAllUserServlet');
    }

    editUser()
    {
        return axios.post('http://localhost:8080/WishTreeProject/EditUser')
    }
}
export default new ApiService();
